main:
	jal pintarF1
	jal pintarPlayer1
		
pintarF1:
	lui $20, 0x1001 #Carrega o endereco base do display no registrador $20
	addi $8, $0, 131072 #Carrega a quantidadede pixels queo video tem 512x256
	j pintarF11
pintarF11:
	beq $8, $0, reset	
	lw $4, 0($20)	
	sw $4, 0($20)
	addi $20,$20,4
	addi $8,$8,-1
	j pintarF11

pintarPlayer1:
	lui $20, 0x1001
	ori $20, $20, 0x0000  # Carrega a parte inferior do endereo base (completa o endereo 0x10010000)
	addi $19, $0, 0x6ABE8  # Deslocamento total em hexadecimal
        addu $20, $20, $19     # Adiciona o deslocamento ao endereo base, guardando o resultado em $20
	addi $8, $0, 13
	addi $9, $0, 13
	addi $25, $0, 0xffffff #adiciona cor branca ao registrador 25
	j pintarPlayerL

pintarPlayerC:
	beq $9, $0, fimN 
	addi $19, $0, 0x7CC  # adiciona 499px em hexadecimal
        addu $20, $20, $19   # desloca 499px ou 1996 bytes a frente
	addi $8, $0, 13 
	addi $9, $9, -1 # Decrementa o contador de colunas
	jal pintarPlayerL

pintarPlayerL:
	beq $8, $0, pintarPlayerC  
	sw $25, 0($20)
	addi $20, $20, 4
	add $8, $8, -1
	j pintarPlayerL
	
reset:
	jr $31

fimN: addi $2, $0, 10
      syscall
     
